   if(token){
    const getUser = async()=>{
     try {
      const res = await axios.get('/user/infor',{
       headers : {Authorization : token}
      })
      console.log(res)
     } catch (error) {
      alert(error.response.data.msg)
     }
    }
    getUser()
   }
 },[token])
